                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Whether you forked out for silverware to make your grandma proud or you have gone for the utilitarian everyday set, it pays to look after your cutlery set. \n\nHere are some simple rules that will help you keep them in top condition:\n\n**1. Give them room!**\nStainless steel is dishwasher-safe, but allow plenty of space between items to avoid movement during the cycle and prevent scratches. \n\n**2. Get them dry ASAP**\nWatch your washing habits to make your stainless steel cutlery last. Prolonged storage in a damp dishwasher can cause rust, so remove and hand-dry a¬fter the cycle is finished. The same goes for handwashing – make sure you dry your cutlery with a tea towel rather than leave it to air-dry.\n\n**3. Make friends with polish and white vinegar**\nA mild abrasive or metal polish will remove marks and stains from stainless steel. For water stains, rub in alcohol or salad oil. To maintain the shine, use a sponge with white vinegar.\n\n**4. Give your silver the silver treatment**\nSilver-plated and sterling-silver cutlery is best washed and dried by hand. It should be stored in a cutlery box or roll to reduce oxidisation, which causes silver to tarnish. If tarnish appears, remove with a quality silver cleaner.\n\n**5. Storage matters**\nStore stainless-steel cutlery in its original canteen to prevent pieces rubbing together. Storing in a kitchen drawer is fine but will reduce the lifespan.'
