                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Crafty touches'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'The simple, uncluttered interior features lots of natural textures and earthy tones, which help keep the family of three active young boys “calm and grounded”, Kimberly says. She and the kids made the colourful bunting that hangs across the carport entrance from ripped, taped and spray-painted calico for a school art show. A designer-like paper pendant over the dining table was also a school project. “I had collected a bunch of old books and I’d guillotine the pages into squares and leave them in my son’s classroom,” Kimberly says. “The kids would fold them in their quiet time. We then glue-gunned them to seven different-sized paper lanterns and entered them in the Byron Bay Writers Festival Sculpture Show where they won the People’s Choice award. It was a very beautiful experience.”\n\nThe home is a short walk to town but could be a thousand miles away. In a lush garden, its relaxed vibe and space to create makes every day a holiday for the family – at home.'
                        }
