                            label: 'Paragraph',
                            content:
                                'Willawong, at Merricks North on Victoria’s picturesque Mornington Peninsula, is a garden that reveals itself slowly with graceful vistas and surprising turns. The first of these moments is the welcoming party – a flock of geese occupying the paddock beside the tree-lined driveway.\n\nGeese can be territorial, often protecting properties like guard dogs, but these birds barely look up when a newcomer arrives. \n\nOwner Jenny Lansell says a gaggle of these rather regal-looking birds was already in residence when she and her husband Cyril bought the property more than 20 years ago. As well as the geese, there were two timber cottages on the property; one was restored, the other replaced.'
