                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Keen on green'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Even before work began on the buildings, Jenny set to work on the garden, enlisting local gardener Martin Edney of [Gardens for Living](http://www.gardensforliving.com.au/|target="_blank") to help bring it to life. \n\nThe garden now occupies 4ha of the 23ha property. Jenny loves mass planting and a swathe of agapanthus edges the driveway, filling the garden with blue flowers in summer.\n\n“The site is sloping and exposed, so our priority was to create level areas and shelter,” says Jenny. Dry-stone terraces were built to the south of the new house, while to the north lawn terraces create a platform for enjoying the country views.\n\nHedges are another signature design element: a thick border of willow-leaved hakea (*Hakea salicifolia*) is planted along the boundary for shelter, while clipped hedges of fragrant Mexican orange blossom (*Choisya ternate*) enclose four sides of the house. There are also low hedges of coastal rosemary (*Westringia fruticosa*) ‘Smokey’.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Standing tall'
                        },
                        {
                            type: 'portrait-image',
                            label: 'Portrait Image',
                            content: {
                                credits: ['HOMES-1523'],
                                tags: [
                                    'food:Location and setting:Australia:Victoria:Mornington Peninsula',
                                    'food:Garden/Outdoor:Garden style:Country garden',
                                    'food:Garden/Outdoor:Plants:Trees',
                                    'food:Garden/Outdoor:Plants:Lawn and grass'
                                ],
                                url: 'http://d3lp4xedbqa8a5.cloudfront.net/s3/digital-cougar-assets/homes/2015/07/29/1438149052203_F5A5915-var.jpg',
                                valid: true,
                                caption: 'In autumn, the ‘oak lawn’ blushes with shades of red and orange.',
                                source: 'Australian House and Garden'
                            }
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Trees are strategically planted for shade and colour. Immediately to the east of the house is an area Jenny calls the oak lawn. It is planted with pin oaks that blush with vibrant reds, oranges and yellows in autumn. \n\nBeside the oaks is a stand of crab apple trees that produce a mass of pink and white flowers in spring. The blooms are followed in late summer by attractive red, yellow and orange ‘crabs’.\n\nNext to the house is the birch lawn, inspired by the random planting theory promoted by the late noted Australian garden designer, Edna Walling. \n\n“I read that Edna Walling tossed a bucket of potatoes out across the lawn to get a random planting pattern so we did that here,” says Jenny. “We tossed the potatoes and planted a birch where each potato landed. It worked well.”'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Fruits of labour'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Hidden away in the centre of Willawong is an oasis-like pool garden and entertaining area. This area is enclosed by self-sufficient Australian natives and drought-hardy succulents, which provide year-round colour. \n\nIn a sheltered sunny spot not far from the kitchen is a Mediterranean-style garden with a formal arrangement of raised beds, overflowing with vegies and herbs. And this is not the only productive area of the garden: a short walk from the house there is an orchard, and beyond that a garden devoted to citrus and still more vegetable gardens, with a large area for pumpkins and raspberries. \n\nMartin is still helping Jenny shape her garden paradise, assisted these days by his son Shannon, who was three when his father started working at Willawong. “Martin’s skill and vision have helped me develop this garden,” says Jenny. “It’s been a joint venture all the way.”'
                        },
                        {
                            type: 'tips',
                            label: 'Tips',
                            content:
                                '## Jenny’s top plants\n* **Liliums:** “Especially because they flower for Christmas.”\n* **Trees:** “Particularly oak trees – they have such fabulous form.”\n* **Succulents:** “They flower so effortlessly by the pool.”\n* **Roses:** “In general, and the ‘Altissimo’ variety in particular, which is so red and glorious on the verandah.”\n* **Vegetables**'
                        }
