                                '“Crumbling, leaking and barely habitable, with an English cottage-style garden scorched by the heat of a fierce summer.” That’s how Nicholas and Fiona Murray describe the 1880s Gothic Revival property in inner Melbourne they bought in 2009. \n\nBut stepping through the dilapidated single-storey, three-bedroom house and into the shade of a 100-year-old ginkgo biloba tree in the garden, they realised this was the ideal location to create a beautiful home for themselves and their children Nixon, eight, and Nouvelle, six.'
