                    body: [
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Environmental considerations were key when the owners of this 19th-century Brisbane cottage added a new bathroom.\n\n “They wanted a generous, luxurious space that was environmentally friendly and celebrated the architectural elements of their cottage,” says Druce Davey, the bathroom’s designer and owner of [Greener Kitchens+Bathrooms](http://www.greenerkitchens.com.au/|target="_blank"). \n\nReclaimed materials and fittings were put to use and the result is a classic bathroom that’s strong on character.  “Working with what you have means you save money and need fewer new materials. Why gut a room when you can celebrate its quirks and character?” says Druce.\n\nThe bathroom project was part of a broader renovation by [Natural Lifestyle Homes](http://nlhomes.com.au/|target="_blank").\n\nArticle from: *Australian House & Garden*\nText: Sarah Pickette\nStyling: Margot Braddon\nPhotos: Emma Reilly'
                        }
                    ],
