                            content:
                                'Droubalgie is an elegant country estate perched on the banks of the Lachlan River in western NSW. It’s the birthplace and part-time residence of renowned industrial designer Charles Wilson and his sister Virginia, an art consultant with a notable clientele. \n\nThe foundations of the homestead were laid in 1862 by Sir Frederick William Pottinger, an aristocratic constable who successfully arrested a notorious local bushranger named Ben Hall. \n\nThe east wing, a simple construction of five rooms, was built first and overlooks what is now a neatly manicured lawn (great for croquet, a game at which Charles excels). \n\nThe rest followed in increments until the 1950s when Jane, a decorator from New Zealand, fell in love with Alan Wilson of NSW and decided to up sticks and move in.'
