                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'A woman’s touch'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Jane brought her high style to Droubalgie and years later, her choices still delight: the rooms are generous, the ceilings high, the proportions perfect. \n\nShe carpeted the long, central hallway in green silk – all the better to pick up the shifting sunlight. The main guestroom – and most contested room – is layered with elaborate printed wallpaper and fabric. A bookshelf in the living room bursts with old volumes on floristry (Jane’s passion) and vintage cars (most definitely Alan’s). \n\nThe Garden Room, a gracious screened annex appended in the 1950s, is where Charles does much of his design work. Commissions for clients like [Herman Miller](http://www.hermanmiller.com/|target="_blank"), [Woodmark](http://woodmark.com.au/|target="_blank"), and [King Living](http://www.kingliving.com.au/|target="_blank") are placed around the house. \n\nIn the living room, Charles’ high-back Seymour swivels in a cut windowpane velour, a chunky matching ottoman at its feet. In the Bird Room, a Seymour low-back steel chair is upholstered in blue – a serene resting point amid the cacophony of print.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Comfort zone'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Droubalgie is a total comfort zone, a place where you don’t ask, “Do you have a..?” but “Where is the..?” Everything is here, and has been for a long time, from the tiny silver tea strainer to vintage pie moulds to antique jigsaw puzzles cut by real jigsaws. There’s even a hacksaw hanging in the kitchen for unwieldy cuts of meat. \n\nAt night, the curtains close with a gravitas that comes with thick linen lining and the carpets are soft underfoot. Encircled by an English-style garden, with endless paddocks beyond, and overlooked by what Charles calls ‘welcome palms’, it’s an oasis of calm on a real working farm. \n\nCharles is clearly at ease here; when not wrangling with the original Aga to whip up memorable meals, he can be found outside, tending his plants.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Modern meets tradition'
                        },
                        {
                            type: 'portrait-image',
                            label: 'Portrait Image',
                            content: {
                                credits: ['HOMES-1421', 'HOMES-1433'],
                                tags: [
                                    'food:Room:Other rooms:Study/Home office',
                                    'food:Decorating:Style:Country',
                                    'food:Products, Furniture and Fittings:Furniture and fittings by room:Kitchen furniture and products:Stool',
                                    'food:Products, Furniture and Fittings:Furniture and fittings by room:Living room furniture:Sofas and couches:Bench seat',
                                    'food:Renovating:Trims and fittings:Glazing/windows:Floor to ceiling windows'
                                ],
                                url:
                                    'http://d3lp4xedbqa8a5.cloudfront.net/s3/digital-cougar-assets/homes/2015/07/29/1438136705837_hg0514UpfrontDroubalgie-C13F7971-5255.jpg',
                                valid: true,
                                caption:
                                    '[Charles Wilson](http://www.charleswilsondesign.com/|target="_blank") at work in the Garden Room. Photo: Maree Homer | Stylist: Kate Nixon',
                                source: 'Australian House and Garden'
                            }
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'For an avowed Modernist designer, Charles’ delight in tradition can surprise. He’s as likely to wax lyrical about the proportions of French doors or the sash window panes as he is to debate the merits of Bauhaus. \n\nIt’s intriguing to see his contemporary designs worked into this gracious heritage home. His latest design, the white onyx Atomic vase, adorns various rooms, and his Serif stool (an occasional seat that appears to be modelled on machinery debris) brings a modern industrial allure to the 19th-century setting. \n\nWhen back in Sydney, Charles lives in a stylish Art Deco apartment with a picture-postcard view of the harbour. Beautiful as it is, Droubalgie is where he’s most at home.'
                        }
