                                            caption:
                                                'Powder-coated louvres provide privacy and environmental control. Steps and retaining wall are made of sandstone excavated on site. \n\n**Louvres** from [JWI Louvres](http://www.jwilouvres.com.au/|target="_blank").',
                                            title: 'hg03Nicholas_108.jpg',
                                            valid: true,
                                            mediaType: 'image',
                                            source: 'Australian House and Garden',
                                            credits: ['HOMES-1461', 'HOMES-1635'],
