                                            caption:
                                                'With a view from the living room, this recent outdoor addition is the owners’ favourite spot in the house. “For parties, we put coloured globes inside the paper lanterns,” says Alex. \n\nThe striped outdoor cushion is from [Maison Montage](http://www.maisonmontage.com.au/|target="_blank"). The skateboard deck on the wall is from [Skater HQ](http://www.skaterhq.com.au/|target="_blank").',
