                                            caption:
                                                'Patrick entertains Jim and Sophie in the kitchen. The family loves that that the area is partly enclosed with appliances and the pantry hidden behind the half wall.\n\nThe **benchtop** is [Caesarstone](http://www.caesarstone.com.au/|target="_blank"). **Stools** from [Thonet](http://www.thonet.com.au/|target="_blank"). *Big Red* **artwork** by [Brett Coehlo](http://coelhoandco.com.au/|target="_blank").',
