                                            caption:
                                                'This peaceful space fuses contemporary and antique elements. “The 19th-century oak country chest started life as a commode holding a chamber pot. At some stage it was converted into a chest of drawers,” Patrick says. The old dressmaker’s dummy holds Alex’s scarfs.\n\n**Quilt cover** and **pillowcases** from [Country Road](http://www.countryroad.com.au/|target="_blank"). **White cushion** from [The Country Trader](http://www.thecountrytrader.com.au/|target="_blank"). **Orange cushions** from [Maison Montage](http://www.maisonmontage.com.au/|target="_blank"). For a similar **throw**, try [St Albans](https://www.stalbans.com.au/|target="_blank").',
