                    source: 'Australian House and Garden',
                    body: [
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'It’s summertime, and the garden is growing faster than ever. You want to entertain outdoors but somehow it’s all got out of hand. It’s time for some quick fixes.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Getting your grass green'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Help for lawns is available in a bottle, with hose-on lawn fertilisers making lawns noticeably greener in about a week. The bottle clicks onto your garden hose and can take as little as two minutes to apply. Try these products:\n* Yates Lawn Master Rapid Greening Lawn Food\n* Munns Organic Lawn Booster \n* Seasol For Lush Green Lawns \n* Amgrow Hose On Lawn Greener \nThese are suitable for any type of lawn in a summer garden, and should be watered in thoroughly after applying. \n\nMow the lawn a day before visitors arrive, but make sure you don’t cut it too short. A longer lawn appears more lush and gives more protection in hot weather.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Speedy weeding'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'If you’re short on time, yank out tall weeds, then cover the rest with newspaper 6-8 sheets thick. Make sure you overlap the edges and tuck it around the plants throughout the bed. Then cover with a layer of mulch, such as sugar cane mulch or fine-grade pine bark, about 30mm thick. \n\nYour garden will look loved, and weeds will be smothered and die. It’s best to do this when the soil is moist, so it can stay moist under the mulch. If it’s windy, wet the newspaper as you work so it won’t blow away. \n\nWhen you have a little more time, you can spray weeds in the garden before you smother them using either a glyphosatebased spray, such as Roundup or Zero, or an organic weed-killer such as Richgro Beat-a-Weed (based on vinegar and salt) or Amgrow Weed Blitz (based on pine oil).'
                        },
                        {
                            type: 'tips',
                            label: 'Tips',
                            content:
                                '## SUPER QUICK SUMMER GARDEN FIXES:\n\n\n* Kill weeds in paving quickly and safely with boiling water, or dab weeds accurately with Roundup Gel.\n* Pot plants at the front door are a great design feature. If yours are looking tired or unwell, replace them.\n* Tuck sugar-cane mulch around vegies, herbs and small flowering plants. This makes them look – and feel – nurtured. \n* Sweep paths and prune back overhanging shrubs for clear access.'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Bright flowers'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Summer is the perfect time to fill your garden with pots of vibrant flowers. Petunias are your best friends in summer. \n\nYou can buy flowering pots of them for a few dollars each, in pastels or rich pinks, purples, red, white, and even striped bi-colours. Look out for ‘spreading’ petunias as these can cover as much as a square metre each. Petunias love sun and will flower for months. Cram them into pots and window boxes or use them along the edge of paving in high-use areas.'
                        }
                    ],
