                            label: 'Paragraph',
                            content:
                                'He told her that his grandmother had been a great cook, and the house was always full of people, food and laughter. After his visit the man sent her a thank you card and a photo of his grandparents. “I hope you know that this house was full of love and joy and happiness, and I hope it brings that to you,” it said. \nAnthea took it as a sign that she should persevere with the renovation. She also decided to return to the original renovation plans. “If you’re going to do something, do it properly or don’t do it at all,” Anthea says.\n\n\nText: Natalie Walton | Photos: Felix Forest | Styling: Sarah Ellison | Styling assistant: Kerrie-Ann Jones | Floorplan: Christina Banos | Article from: *real living*'
