                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Open-plan family spaces'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Family members spend much of their time on the middle level, which features a long, open-plan living, kitchen and dining space, with windows along the northern side and a floor-to-ceiling sliding door that opens to the backyard. \n\n\nIt’s completely private, yet open, airy, and filled with natural light. “In our last home, we found we only lived in one room,” says Gerard. “We didn’t want to waste any space, so asked the architects to design one main living area.”\n\n\nThis open-plan scheme mixes French oak, jarrah and pressed tin, with a refreshing slice of green in the kitchen cabinetry. The last was a point of contention between husband and wife. “I wanted green and Gerard wanted yellow,” says the victor, Kristen, with a laugh. “The pop of vibrant colour is a signature of the architects.”'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Spaces designed for today and tomorrow'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Harry and Sam’s rooms, along with their splash-proof bathroom and a laundry, lie behind the kitchen. The hallway leading to their rooms can be closed off from the main living area. A study nook has been incorporated into the hall and, while Kristen catches up on emails there now, it’s a future-proof inclusion that the boys will also use in years to come. On the top level is the large main bedroom, with windows that wrap around the exterior for ocean views.\n\n\n“While the upstairs area is our escape, as a family we live in the main area, eating, playing and enjoying time together,” says Kristen. “This house has given us everything that we need to live together happily and easily.”'
                        },
                        {
                            type: 'tips',
                            label: 'Tips',
                            content:
                                '## 5 clever design ideas\n\n**1. Fitting in:** Klopper & Davis Architects drove around the surrounding neighbourhood to get a feel for the local style. They noticed bricks featured heavily and incorporated bricks from the site’s original house in the exterior. “It gives the house a grounded sort of feeling,” says Gerard.\n\n**2. Eco-friendly:** “We have louvres at the front and back of the house, and at the top and bottom, so we have natural air movement that cools the house in summer,” says Kristen. “And, with the big windows on the northern side, our interior is naturally heated in winter.”\n\n**3. Splish splash:**  The main bathroom used by Harry and Sam is completely waterproof. “It is like a European-style wet room, which is brilliant!” says Gerard. “The kids can splash and you don’t have to worry.”\n\n**4. Hole-proof:** The couple specified a hanging rail for displaying art in the living room. “We had seen it somewhere and we thought it was a better idea than holes in the wall,” says Gerard.\n\n**5. Wash off:** The original plan was to have an outdoor shower in the backyard, but they decided to lay grass for the kids instead. “It made sense to us to have the outdoor shower near the entrance for rinsing off after we’ve been to the beach,” says Gerard.'
                        }
