                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'The big changes'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'The house has three large bedrooms – a main, a child’s and a guest room – with high ceilings and plenty of tongue-and-groove walls. The first priority was getting rid of the old colour scheme – baby blue and canary yellow – and slapping on loads of white paint. \n\n\nThey then built decks at the front and the back, gutted the kitchen, closed in a small front porch to build an ensuite, gutted the main bathroom, re-roofed the whole house and built a carport and an art studio.\n\n\nThey’re not finished yet. Lisa says when it comes to a place that’s around 80 years old, you never really stop renovating. “As our family grows and our style changes, the house just seems to morph with us,” Lisa says'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Shopping for bargains'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Lisa’s weatherboard home is full of her decorating finds from local stores, as well as prized family heirlooms and things she’s made herself. When it comes to shopping, Lisa describes herself as a “bargain queen”.\n\n\n“I love nothing more than haggling for a good deal, jumping for joy at an amazing find or rescuing old pieces and breathing new life into them,” she says.'
                        },
                        {
                            type: 'portrait-image',
                            label: 'Portrait Image',
                            content: {
                                credits: ['HOMES-1617', 'HOMES-1556'],
                                tags: [],
                                url:
                                    'http://dev.assets.cougar.bauer-media.net.au/s3/digital-cougar-assets-dev/homes/2015/07/27/1437965420164_CF021544-TobyScott.jpg',
                                valid: true,
                                caption:
                                    'The main bedroom features fresh white linen, with a touch of pastel pink and grey against a charcoal wall. “White will always work but it needs to have some texture,” says Lisa. Photo: Toby Scott',
                                source: 'homes+'
                            }
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Lisa describes her decorating style as an “ever-changing mix of modern, classic and vintage decor”. “I love surrounding myself with things that make me smile,” she says. \n\n\nShe mixes pre-loved items or a bygone look with something modern. Lisa likes to shop at Noosa stores such as [Lamington](http://lamington.net.au/|target="_blank") and [Eclectic Style](http://eclecticstyle.com.au/|target="_blank"). \n\n\n“Lamington has small pieces that are modern and edgy,” she says, “while Eclectic Style is great for individual lamps and larger pieces of furniture.”'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'More renovations'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Even after a decade of renovations, Lisa still dreams of doing more to the house. “I’d love to reinstate the casement windows at the front for street appeal and I do have a secret grand plan for a major living extension off the rear of the house,” she reveals.\n\n\nThis means the blokes won’t be playing golf anytime soon. “But that’s okay,” Lisa says. “It’s been a labour of love.”'
                        }
