                    body: [
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'China comes in several forms, including fine bone china, porcelain and stoneware. “Despite its delicate appearance, fine bone china is actually the strongest,” says Jane Varley, marketing manager at WWRD Australia, distributors of *Waterford*, Wedgwood, Royal Doulton and Royal Albert ranges. \n\n“Many people are scared to use fine china, but they shouldn’t be,” says Joseph D’Rozario, butler at The Hotel Windsor in Melbourne, where afternoon tea is served on Noritake fine china. “It’s there to be enjoyed, and with proper care should last a lifetime.”  '
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Cleaning'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                '“It’s safe to wash china in a dishwasher as long as the machine is stacked properly and not over-filled,” says D’Rozario. Varley agrees. “Rinse pieces before placing them in the machine and make sure that items don’t bump against each other.” She advises using a gentle wash cycle with a maximum temperature of 65˚C. '
                        },
                        {
                            type: 'quote',
                            label: 'Quote',
                            content: 'Avoid over-stacking – no more than four plates high – as the weight can weaken the rims and cause damage.'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'Older or heavily decorated china is best washed by hand with warm, soapy water and a soft cloth, rather than using harsh scrubbers that could potentially scratch the pattern.  '
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Maintenance'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                'China that is used and enjoyed will get the odd mark but most of these come out fairly easily, says Varley. “Remove tea or coffee stains with a weak bleach solution or bicarb soda mixed with water, and for ‘pencil’ marks caused by cutlery use silverware cleaner or Bar Keepers Friend.” Scratches, cracks and fading are another matter and may call for a replacement piece. \n\n\nIf you find that your pattern has been discontinued, try a specialist website such as [chinamatching.com.au](http://chinamatching.com.au/|target="_blank") or [chinafinders.com.au](http://chinafinders.com.au/|target="_blank").'
                        },
                        {
                            type: 'heading',
                            label: 'Heading',
                            content: 'Storage'
                        },
                        {
                            type: 'paragraph',
                            label: 'Paragraph',
                            content:
                                '“When stacking plates, put a linen cloth between each piece so there’s no risk of marking the one underneath,” says D’Rozario. Avoid over-stacking – no more than four plates high – as the weight can weaken the rims and cause damage. Cups and mugs should not be stacked or hung by their handles, which can result in cracks or scratches. \n\nAnd be mindful of extreme temperature changes. “For example, never transfer a bone china plate straight from the fridge into a hot oven,” says Varley. '
                        }
                    ],
