                                'A blade wall in cross-cut travertine gives the room a strong focus (and sets off border collie Pip’s coat). Collected treasures, such as the ceramics on the lounge fireplace mantel, date from the 1960s and ’70s and are a feature of the home. “My mother started a pottery/arts and crafts centre in Lane Cove in the ’70s so I have an affinity to pieces like this,” Patrick says. \n\nNorman+Quaine Hudson **sofa** (in striped fabric), from [Living Edge](http://www.livingedge.com.au/|target="_blank").**Lamp** from [Ikea](http://www.ikea.com.au/|target="_blank"). **Heater** from [Jetmaster](http://www.jetmaster.com.au/|target="_blank"). **Throw** from [Maison Montage](http://www.maisonmontage.com.au/|target="_blank"). **ON MANTLEPIECE** **Candleholders** from [Country Road](http://www.countryroad.com.au/|target="_blank"). **Paper ball** from [Leura Fine Woodwork Gallery](http://www.finewoodwork.com.au/|target="_blank"). Shaft **artwork** by Elwyn Lynn. The timber Cubebot robot by David Weeks is from [Dedece](http://www.dedece.com/|target="_blank").',
